export const MapPaths: React.FC<MapPathsProps> = React.memo(({ correctCountry, incorrectCountry }) => {
  const getCountryClass = (code: string) => {
    if (code === correctCountry) return 'country correct';
    if (code === incorrectCountry) return 'country incorrect';
    return 'country';
  };

  return (
    <g>
      {PATHS.map(p => (
        <path
          key={p.id}
          id={p.id}
          className={getCountryClass(p.id)}
          vectorEffect="non-scaling-stroke"
          stroke="#ffffff"
          strokeWidth={0.5}
          d={p.d}
        />
      ))}
    </g>
  );
});

export default MapPaths;
